import React, { Component } from "react";
import { Form, Button } from "react-bootstrap";
import "./RegisterForm.css";

class RegisterForm extends Component {
  state = {
    value: +372,
  };
  change = (event) => {
    this.setState({ value: event.target.value });
  };
  render() {
    return (
      <div className="setting">
        <div className="s-form">
          <Form>
            <Form.Group controlId="formBasicPhone">
              <Form.Label className="inputLable">Phone number</Form.Label>

              <div className="drop">
                <div className="dropDown">
                  <div className="countryCode">{this.state.value}</div>
                  <select
                    className="select"
                    name="code"
                    onChange={this.change}
                    value={this.state.value}
                  >
                    <option value="+372" defaultValue>
                      Estonia
                    </option>
                    <option value="+358">Finland</option>
                    <option value="+47">Norwar</option>
                    <option value="+45">Danmark</option>
                    <option value="+1">USA</option>
                    <option value="+46">Sweden</option>
                  </select>
                </div>
              </div>
              <Form.Control
                className="input phoneNumber"
                type="number"
                placeholder="401234567"
              />
            </Form.Group>

            <Form.Group controlId="formBasicPassword">
              <Form.Label className="inputLable">Password</Form.Label>
              <Form.Control className="input" type="password" />
            </Form.Group>
            <div className="loginButton">
              <Button
                className="c-btn c-btn-small"
                variant="primary"
                type="submit"
              >
                Login
              </Button>
            </div>
          </Form>
        </div>
      </div>
    );
  }
}
export default RegisterForm;
